INSERT INTO `productdefinition` VALUES (1,'2018-06-20 12:55:40','2018-06-20 12:55:42','<p>(alcool 9 % vol.)</p>\r\n<p>Médaille d’argent au Concours Général Agricole de Paris en 2017.</p>\r\n<p>La Choulette ambrée Triple vous est pro&shy;po&shy;sée en bou&shy;teille de 75 cl.</p>\r\n<p>À la bras&shy;se&shy;rie arti&shy;sa&shy;nale La Choulette, Alain Dhaussy a choisi de renou&shy;ve&shy;ler la tra&shy;di&shy;tion fami&shy;liale en élaborant une savou&shy;reuse bière de garde Triple. dans la plus grande tra&shy;di&shy;tion des arti&shy;sans bras&shy;seurs.</p>\r\n<p>La Choulette Triple est bras&shy;sée avec une sélec&shy;tion de malts blonds et ambrés et de hou&shy;blons aro&shy;ma&shy;ti&shy;ques.</p>\r\n<p>La Choulette ambrée Triple est coif&shy;fée d’une mousse ivoire dense et géné&shy;reuse. Elle exhale un arôme puis&shy;sant avec des notes d’épices et de cara&shy;mel. Son amer&shy;tume sou&shy;li&shy;gne cet ensem&shy;ble har&shy;mo&shy;nieux.</p>\r\n<p><em>Bière artisanale fabriquée en France. Contient du malt d’orge. A conserver dans un endroit frais et sec, à l’abris de la lumière.</em></p>\r\n<p><em>L’abus d’alcool est dangereux pour la santé, à consommer avec modération.</em></p>\r\n<p><em>La consommation de boissons alcoolisées pendant la grossesse, même en faible quantité, peut avoir des conséquences graves sur la santé de l’enfant.</em></p>','Choulette Ambrée Triple',1,''),(2,'2018-06-28 09:08:08','2018-06-28 09:08:12','Biere Blonde de luxe','biere blonde de luxe',1,''),(3,'2018-06-28 09:08:13','2018-06-28 09:08:13','Elue Médaille de Bronze 2016 au Concours Général Agricole à Paris. \r\n\r\nCette bière est dorée, à la mousse fine et dense. Ses arômes riches et fruités offrent un bon équilibre entre le malt et la levure. Elle est moelleuse en bouche avec une amertume douce, juste persistante.','La Choulette Blonde',1,''),(4,'2018-06-28 09:08:14','2018-06-28 09:08:15','Notre bière de Noël cuvée 2017 est encore une fois très réussie!','Choulette Noel',1,''),(5,'2018-06-28 18:46:18','2018-06-28 18:46:54','Une bière blonde artisanale créée pour commémorer cette bataille et rendre hommage à l’armée britannique.\r\n\r\nBière artisanale fabriquée en France. Contient du malt d’orge. A conserver dans un endroit frais et sec, à l’abri de la lumière.','Battle of Cambrai',1,''),(6,'2018-09-27 13:33:39','2018-09-27 13:33:39','La Choulette Ambrée (8%) est le résultat d’une sélection rigoureuse de malts spéciaux aromatiques qui lui confèrent un bon goût de caramel. Rousse, aux reflets cuivrés, à la mousse dense et ivoire, cette bière exhale un arôme riche en notes de pruneau.\r\n\r\nBière artisanale fabriquée en France. Contient du malt d’orge. A conserver dans un endroit frais et sec, à l’abri de la lumière.\r\n\r\nL’abus d’alcool est dangereux pour la santé, à consommer avec modération.\r\n\r\nLa consommation de boissons alcoolisées pendant la grossesse, même en faible quantité, peut avoir des conséquences graves sur la santé de l’enfant.','La Choulette Ambrée',1,''),(7,'2018-09-27 13:35:47','2018-09-27 13:35:47','La Choulette fraise (5%)\r\n\r\nBière à la fraise (9% de jus) aromatisée aux arômes naturels.','La Choulette Fraise',1,''),(8,'2018-09-27 13:36:05','2018-09-27 13:36:05','La Choulette cerise (5%)\r\n\r\nBière à la cerise (9% de jus) aromatisée aux arômes naturels.','La Choulette Cerise',1,''),(9,'2018-09-27 13:36:20','2018-09-27 13:36:20','La Choulette framboise (6%)\r\n\r\nBière à la framboise (9% de jus) aromatisée aux arômes naturels.','La Choulette Framboise',1,''),(10,'2018-09-27 13:36:46','2018-09-27 13:36:46','La Choulette pêche (5%)\r\n\r\nBière à la pêche (9% de jus) aromatisée aux arômes naturels.','La Choulette Pêche',1,''),(12,'2018-09-27 13:37:39','2018-09-27 13:37:39','<p>Elue Médaille de Bronze 2016 au Concours Général Agricole à Paris. Cette bière est dorée, à la mousse fine et dense. Ses arômes riches et fruités offrent un bon équilibre entre le malt et la levure. Elle est moelleuse en bouche avec une amertume douce, juste persistante.</p>','La Choulette Brune',1,''),(13,'2018-09-27 13:38:06','2018-09-27 13:38:06','(alcool 7 % vol.)\r\n\r\nL’bière artisanale qui fait parler comme ichi !\r\n\r\nUne bière blonde agréable à boire, pour tous les amateurs et passionnés du pays des Ch’ti.\r\nUne bière dédiée, aux nombreux artistes compositeurs qui font vivre le patois du Nord avec bonne humeur comme Patrick Collon\r\nCe n’est pas des Cafougnettes ! …. A consommer entre amis.','la hé biloute blonde',1,''),(14,'2018-09-27 13:38:22','2018-09-27 13:38:22','(alcool 9% vol.)\r\n\r\nL’ambrée : les malts aromatiques et les épices soulignent ses rondeurs.\r\n\r\nLa Bière des Sans Culottes a été créée en 1983 pour rendre hom­mage aux révo­lu­tion­nai­res de 1789 qui avaient libé­ré la bière de nom­breu­ses taxes et contrain­tes dans sa fabri­ca­tion et sa dis­tri­bu­tion.\r\nMais la bière n’est pas sérieuse, alors depuis 30 ans, cette marque Sans Culottes a sou­vent été prise au pre­mier degré et pré­texte à plai­san­te­ries et jeux de mots.\r\nL’idée est donc venue de réa­li­ser une série de bières fes­ti­ves et ori­gi­na­les, sous la marque ombrelle « Bière des Sans Culottes ». C’est l’Itinéraire des Bières des Sans Culottes.\r\n\r\nLe parti pris du pre­mier degré et de l’humour a été confié à L.M. Carpentier et à son confrère et ami Malik, auteurs de bandes dessinées entre autres sur le thème de la bière.','Sans-Culottes Blonde Corsée',1,''),(15,'2018-09-27 13:38:50','2018-09-27 13:38:50','(alcool 8,5% vol.)\r\n\r\nLa blonde corsée : la densité et les épices mettent en valeur un corps remarquable.\r\n\r\nLa Bière des Sans Culottes a été créée en 1983 pour rendre hom­mage aux révo­lu­tion­nai­res de 1789 qui avaient libé­ré la bière de nom­breu­ses taxes et contrain­tes dans sa fabri­ca­tion et sa dis­tri­bu­tion.\r\nMais la bière n’est pas sérieuse, alors depuis 30 ans, cette marque Sans Culottes a sou­vent été prise au pre­mier degré et pré­texte à plai­san­te­ries et jeux de mots.\r\nL’idée est donc venue de réa­li­ser une série de bières fes­ti­ves et ori­gi­na­les, sous la marque ombrelle « Bière des Sans Culottes ». C’est l’Itinéraire des Bières des Sans Culottes.\r\n\r\nLe parti pris du pre­mier degré et de l’humour a été confié à L.M. Carpentier et à son confrère et ami Malik, auteurs de bandes dessinées entre autres sur le thème de la bière.','la sans-culottes blonde corsée',1,''),(17,'2018-09-27 13:44:28','2018-09-27 13:44:28','(alcool 9% vol.)\r\n\r\nL’ambrée : les malts aromatiques et les épices soulignent ses rondeurs.\r\n\r\nLa Bière des Sans Culottes a été créée en 1983 pour rendre hom­mage aux révo­lu­tion­nai­res de 1789 qui avaient libé­ré la bière de nom­breu­ses taxes et contrain­tes dans sa fabri­ca­tion et sa dis­tri­bu­tion.\r\nMais la bière n’est pas sérieuse, alors depuis 30 ans, cette marque Sans Culottes a sou­vent été prise au pre­mier degré et pré­texte à plai­san­te­ries et jeux de mots.\r\nL’idée est donc venue de réa­li­ser une série de bières fes­ti­ves et ori­gi­na­les, sous la marque ombrelle « Bière des Sans Culottes ». C’est l’Itinéraire des Bières des Sans Culottes.\r\n\r\nLe parti pris du pre­mier degré et de l’humour a été confié à L.M. Carpentier et à son confrère et ami Malik, auteurs de bandes dessinées entre autres sur le thème de la bière.','Sans Culottes Blonde Légère',1,''),(18,'2018-11-06 14:02:15','2018-11-06 14:02:15','<p>(alcool 8,5&nbsp;% vol.)</p>\r\n<p>Bière&nbsp;refermentée en bouteille, la Choulette blonde Triple vous est pro&shy;po&shy;sée en format&nbsp;75 cl.</p>\r\n<p>Sa mousse blanche est fine et dense. Son bouquet très parfumé, sa rondeur, sa longueur en bouche et sa franche amertume en font une bière très équilibrée.</p>','Choulette Blonde Triple',1,''),(19,'2018-11-06 21:57:20','2018-11-06 21:57:20','Val des Cygnes BIO','Val des Cygnes BIO',1,''),(20,'2018-11-06 21:58:20','2018-11-06 21:58:20','La Bière de l\'Abbaye de Vaucelles','La Bière de l\'Abbaye de Vaucelles',1,''),(21,'2018-11-06 21:59:17','2018-11-06 21:59:17','La Tour d\' Ostrevant','La Tour d\' Ostrevant',1,''),(22,'2018-11-06 22:00:16','2018-11-06 22:00:16','La Blanche de Cambrai','La Blanche de Cambrai',1,''),(23,'2018-11-06 22:01:17','2018-11-06 22:01:17','La Triboulette','La Triboulette',1,''),(24,'2018-11-06 22:02:08','2018-11-06 22:02:08','Hé Biloute t\'es d\'min coin? Ambrée','Hé Biloute t\'es d\'min coin? Ambrée',1,''),(25,'2018-11-06 22:02:41','2018-11-06 22:02:41','Hé Biloute t\'es d\'min coin? Blonde','Hé Biloute t\'es d\'min coin? Blonde',1,''),(26,'2018-11-06 22:03:14','2018-11-06 22:03:14','La D\'Artagnan','La D\'Artagnan',1,''),(27,'2018-11-06 22:03:46','2018-11-06 22:03:46','La Porte du Hainaut Blonde','La Porte du Hainaut Blonde',1,''),(28,'2018-11-06 22:03:53','2018-11-06 22:03:53','La Porte du Hainaut Ambrée','La Porte du Hainaut Ambrée',1,''),(29,'2018-11-06 22:06:16','2018-11-06 22:06:16','(alcool 8,5% vol.)\r\n\r\nDédié en l’honneur de Wilfred Owen (poète britannique de la 1er guerre mondiale), c’est une bière de caractère fabriquée à partir de malts d’orge et de houblons des Flandres. Elle est d’un blond intense avec une mousse légère, persistante et de couleur blanche. Elle dégage des arômes maltés et levurés avec des notes fruitées. En bouche, elle est ronde et pétillante avec en finale une légère amertume.','Wilfried Owen',1,''),(30,'2018-11-06 22:08:50','2018-11-06 22:08:50','(alcool 7% vol.)\r\n\r\nMédaille d’Argent au World Beer Championships en 1995 à Chicago.\r\n\r\nCette bière est brassée dans la plus pure tradition des brasseries du Nord.\r\nC’est une une bière de garde authentique, dorée, ronde et parfumée.\r\n\r\nServie à une température entre 8° et 10°C, elle révèle\r\nla finesse de son amertume et tout son caractère.','Sans Culottes Historique',1,''),(31,'2018-11-06 22:12:05','2018-11-06 22:12:05','Sans-Culottes Ambrée','Sans-Culottes Ambrée',1,''),(32,'2018-11-06 22:28:28','2018-11-06 22:28:28','Sans-Culottes Cerise','Sans-Culottes Cerise',1,''),(33,'2018-11-06 22:34:53','2018-11-06 22:34:53','Sans-Culottes de Noel','Sans-Culottes de Noel',1,'');
